import React from 'react';
import { Link } from 'react-router-dom';
import { navbarSection ,  } from './style';

const Navbar =() => {
  return (
    <div className="navbar">
        
        <div className="container">
            
            <div className="logo">
                <h2 className="logo-text">Ultra Profile</h2>
            </div>
            
            <ul className="ul-list">
                <li className="list-item"><Link to="/">Home</Link></li>
                <li className="list-item"><a to="#">Work</a></li>
                <li className="list-item"><a to="#">Portfolio</a></li>
                <li className="list-item"><a to="#">Resume</a></li>
                <li className="list-item"><a to="#">About</a></li>
                <li className="list-item"><Link to="/contact">Contact</Link></li>
            </ul>
            
        </div>
    </div>
  );
}

export default Navbar;
